INSERT INTO `v1_b97884702d7417d543503ac9dcee74e8b61bc8e89940e28cef2d6eaf780c442e` VALUES (0.5, 11, 23814, 0, 1, "そ、そうだったんですか……？\nクウカは、あんまり歴史とか時事とかに\n詳しくないので、そんなすごい日\nだったなんて知りませんでした……", 104511, 10, 1, 23814074, 0);
