INSERT INTO `v1_b97884702d7417d543503ac9dcee74e8b61bc8e89940e28cef2d6eaf780c442e` VALUES (0.5, 11, 34314, 0, 1, "ついにこの日がやってきたの～！\n今日はミヤコの誕生日なんだから、\n山のようにプリンを用意して、\n盛大にお祝いするの～♪", 100711, 10, 1, 34314071, 0);
