INSERT INTO `v1_b97884702d7417d543503ac9dcee74e8b61bc8e89940e28cef2d6eaf780c442e` VALUES (0.5, 11, 37914, 0, 1, "馬鹿を言うんじゃあない後輩たち。\nこうも膳立てされて食わぬ腹があるか。\n君らの気持ち、しかと受け止めてやる。\n端的に換言すれば、ぼくをハブるな。", 111011, 10, 1, 37914068, 0);
