INSERT INTO `v1_b97884702d7417d543503ac9dcee74e8b61bc8e89940e28cef2d6eaf780c442e` VALUES (0.5, 11, 38014, 0, 1, "あら、私も本なのよ。\n「猫でもわかる麦しゅわの歴史」って\n本だけど、これを読んで麦しゅわへの\n理解を深めてね♪", 103411, 10, 1, 38014073, 0);
