INSERT INTO `v1_b97884702d7417d543503ac9dcee74e8b61bc8e89940e28cef2d6eaf780c442e` VALUES (0.5, 11, 38214, 0, 1, "マヒルさん、どうしました……？\nもしかして、誕生日ケーキに\n変なところでも……？", 103811, 10, 1, 38214070, 0);
